import React, { useState, useEffect } from "react";

function PoEExchanges() {
  const [data, setData] = useState(null); // Will hold the JSON data
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch the JSON from public/prices.json (or your endpoint)
    fetch("/prices.json")
      .then((res) => {
        if (!res.ok) {
          throw new Error("Network response was not ok");
        }
        return res.json();
      })
      .then((json) => {
        setData(json);
      })
      .catch((err) => {
        setError(err.message);
      });
  }, []);

  // If we have an error
  if (error) {
    return <div>Error: {error}</div>;
  }

  // If data is still loading
  if (!data) {
    return <div>Loading...</div>;
  }

  // data is ready
  return (
    <div>
      <h2>Path of Exile Exchange Data</h2>
      <p>Last Updated: {data.updated}</p>

      {data.exchanges.map((exchange, index) => (
        <ExchangeCard key={index} exchange={exchange} />
      ))}
    </div>
  );
}

export default PoEExchanges;
